import React from 'react';
import axios from 'axios';



class Quiz extends React.Component{
  state = {
    words : [],
    quizQuestions : [],
    curr_question : 0
  }
  componentDidMount(){
    axios.get('/listwords').then((res) => {
      // console.log(res);
      this.setState({
        words : res.data
      });
    })
  }
  render(){
    if(this.state.words.length <= 0){
      return <div>No words added yet...</div>
    }
    return (
      <div>
        {}        
      </div>
    );
  }
}

export default Quiz;
